types/objects/defining_objects.md commit 693405afa5a86df3a2277065696e7c42306ff630 尽管 Rust 中的任何类型都可以暴露为 GraphQL 对象，但最常见的类型是结构体（struct）。 Juniper 中，有两种方式创建 GraphQL对象：如果想要暴露一个简单结构体（struct），最简单的方式是自定义派生属性；另外一种方式将在 复杂字段 章节中介绍。 #[derive(juniper::GraphQLObject)]
struct Person { name: String, age: i32,
} # fn main() {} 上述代码将创建一个名为 Person 的 GraphQL 对象，有两个字段：String! 类型的 name，Int! 类型的 age。Rust 语言类型系统中，变量绑定默认为非空（non-null）。若您需要可空（nullable）字段，可以使用 Option<T>。 我们应当利用 GraphQL 是自文档化（self-documenting）的特点，向类型和字段添加描述。Juniper 将自动使用关联的 Rust 文档注释作为 GraphQL 描述： !文件名 通过 Rust 文档注释作为 GraphQL 描述 #[derive(juniper::GraphQLObject)]
/// 个人信息
struct Person { /// 个人全名，包括姓氏和名字 name: String, /// 个人年龄，以年为单位，按月份四舍五入 age: i32,
} # fn main() {} Rust 中不能使用文档注释的对象和字段，可通过 graphql 属性设置描述。如下示例和上述代码等价： !文件名 通过 graphql 属性设置描述 #[derive(juniper::GraphQLObject)]
#[graphql(description="个人信息")]
struct Person { #[graphql(description="个人全名，包括姓氏和名字")] name: String, #[graphql(description="个人年龄，以年为单位，按月份四舍五入")] age: i32,
} # fn main() {} 通过 graphql 属性设置的描述优先于 Rust 文档注释，这使得内部 Rust 文档和外部 GraphQL 文档能够不同： #[derive(juniper::GraphQLObject)]
#[graphql(description="这段描述展示在 GraphQL")]
/// 这段描述展示在 RustDoc
struct Person { #[graphql(description="这段描述展示在 GraphQL")] /// 这段描述展示在 RustDoc name: String, /// 这段描述在 RustDoc 和 GraphQL 中都展示 age: i32,
} # fn main() {}

