} #[juniper::object]
impl Person { fn name(&self) -> &str { self.name.as_str() } fn age(&self) -> i32 { self.age }
} # fn main() { } 虽然上述示例代码有点冗长，但它允许您在字段解析器中编写任何类型的函数。同时，使用上述示例语法，字段可以接受参数： #[derive(juniper::GraphQLObject)]
